import windows from "../../../Assets/svg/windows.svg";
import apple from "../../../Assets/svg/apple.svg";
import android from "../../../Assets/svg/android.svg";
import phone from "../../../Assets/svg/phone.svg";

export const cartList = [
  {
    img: cartItem1,
    title: "War Arena: Titan Wars",
    type: "Action",
    whoCan: "EVERYONE +13",
    device1: desktop,
    device2: windows,
    device3: apple,
  },
  {
    img: cartItem2,
    title: "Glymber",
    type: "Adventure",
    whoCan: "EVERYONE",
    device1: phone,
    device2: android,
    device3: apple,
  },
];
